import React from 'react'

function UserInput() {
  return (
    <div className='w-11/12'>
        <div className="flex">
            <input type="text" className='w-w-3/4 rounded-2xl bg-slate-800 text-white outline-none mx-auto  py-5 px-5' />
        </div>
    </div> 
  )
}

export default UserInput
